import React,{ Component } from 'react';
import dchannel from "../img/dchannel.jpg";
import {Link} from "react-router-dom";
import { FaLongArrowAltLeft,FaMinus,FaPlus } from 'react-icons/fa';
class Register extends Component{
    render() {
        return(

            <div className="wrap">
                <div className="container">
                    <div className="login">
                        <div className="title-bar">
                            <p><Link to="/login" className="cl-white icon" value="login"><FaLongArrowAltLeft/></Link>Register</p>
                        </div>
                        <div className="form-content">
                            <p className="text-right">
                                <Link to="/login" value="register">Already have TMD-Account ?</Link>
                            </p>
                            <form className="form">
                                <input type="text" name="" placeholder="Email" required=""/>
                                <input type="name" name="" placeholder="Your Name" required=""/>
                                <input type="phone" name="" placeholder="Phone No" required=""/>
                                <input type="email" name="" placeholder="Your Email" required=""/>
                                <input type="password" name="" placeholder="Confirm Password" required=""/>
                                <input type="drug" name="" placeholder="Clinic or Drug-store Name" required=""/>
                                <input type="address" name="" placeholder="Clinic or Drug-store Address" required=""/>
                                <button className="btn-com">
                                    <Link to="/login" className="" value="register">REGISTER</Link>
                                </button>
                            </form>
                        </div>
                    </div>
                </div>

            </div>
        );
    }
}
export default Register;
